import React from 'react';

export function ActionButtons() {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', margin: '20px 0' }}>
      <input
        type="text"
        placeholder="Tìm kiếm đồ uống..."
        style={{
          padding: '8px',
          width: '300px',
          border: '1px solid #ccc',
          borderRadius: '4px'
        }}
      />
      <div>
        <button className="button" style={{ marginRight: '10px' }}>Xuất Excel</button>
        <button className="button">+ Thêm sản phẩm mới</button>
      </div>
    </div>
  );
}

export function StatusButtons() {
  return (
    <div className="status-buttons">
      <button className="status selling">Đang bán</button>
      <button className="status out">Hết hàng</button>
      <button className="status paused">Tạm ngưng</button>
    </div>
  );
}
